import style from './Card.module.css'

export default function Card({id,name,status,gender,species,origin,image,onClose}) {
   return (
      <div className={style.container}>
         <div className={style.ButtonDi}> <button onClick={onClose} className={style.CloseButton}>X</button> </div>
         <div className={style.status}> {status} </div>
         <img src={image} alt='' />
         <h2>Name: {name} ({gender}) </h2>
         <h3>Species: {species} </h3><h4>Origin: {origin} </h4>
          
      </div>
   );
}
